import { useState } from "react";
import styled from "styled-components";
// import dog from "./dog.jpeg";

export const Carousel = () => {
  // const [isOpen, setIsOpen] = useState(false);
  const anotherimg = () => {
    console.log(event);
  };

  return (
    <>
      <Body>
        <CarouselContainer>
          <ImgDiv>
            <img
              style={{ width: "60vw", height: "100%", float: "left" }}
              src={process.env.PUBLIC_URL + `/rabbit.gif`}
            />
          </ImgDiv>
          <ImgDiv>
            <img
              style={{ width: "60vw", height: "100%", float: "left" }}
              src={process.env.PUBLIC_URL + `/dog.jpeg`}
            />
          </ImgDiv>
          <ImgDiv>
            <img
              style={{ width: "60vw", height: "100%", float: "left" }}
              src={process.env.PUBLIC_URL + `/cat.jpeg`}
            />
          </ImgDiv>
        </CarouselContainer>
        <ButtonContainer>
          <button value={1} onClick={anotherimg}></button>
          <button value={2} onClick={anotherimg}></button>
          <button value={3} onClick={anotherimg}></button>
        </ButtonContainer>
      </Body>
    </>
  );
};

export const CarouselContainer = styled.div`
  display: flex;
  width: 300%;
`;

export const ButtonContainer = styled.div`
  display: flex;
  justify-content: center;
`;

export const Body = styled.div`
  height: 45vw;
  width: 60vw;
  overflow: hidden;
`;

export const ImgDiv = styled.div``;
